    //B64ToWindowedAverageToB64
    public static class B64ToWindowedAverageToB64
    {
        public static void Run(Stream input, Stream output)
        {
            StreamHolder.Stream = new UpdateStream(output);
            var transducer = new B64ToWindowedAverageToB64_Base64Decoder();
            byte[] buffer = new byte[4096];
            int read;
            while ((read = input.Read(buffer, 0, buffer.Length)) > 0)
            {
                for (int i = 0; i < read; ++i)
                {
                    transducer.Update(buffer[i]);
                }
            }
            transducer.Finish();
        }
    }
