    //B64ToWindowedAverageToB64
    class B64ToWindowedAverageToB64_Base64Decoder
    {
        byte previousValue;
        int bitsNeeded = 0;
        bool ending = false;
        bool morePaddingExpected;

        int DecodeValue(byte c)
        {
            if ('A' <= c & c <= 'Z')
            {
                return c - 'A';
            }
            else if ('a' <= c & c <= 'z')
            {
                return 26 + (c - 'a');
            }
            else if ('0' <= c & c <= '9')
            {
                return 52 + (c - '0');
            }
            else if (c == '+')
            {
                return 62;
            }
            else
            {
                return 63;
            }
        }

        public void Update(byte c)
        {
            if (c == '=')
            {
                if (!ending)
                {
                    ending = true;
                    if (bitsNeeded == 0 | bitsNeeded == 2)
                    {
                        throw new Exception();
                    }
                    else
                    {
                        morePaddingExpected = (bitsNeeded == 4);
                    }
                }
                else
                {
                    if (!morePaddingExpected)
                    {
                        throw new Exception();
                    }
                    morePaddingExpected = false;
                }
            }
            else
            {
                if (ending)
                {
                    throw new Exception();
                }

                int value = DecodeValue(c);

                if (bitsNeeded != 0)
                {
                    next.Update((byte)((previousValue << bitsNeeded) | (value >> (6 - bitsNeeded))));
                }
                previousValue = (byte)value;

                //bitsNeeded = (bitsNeeded + 2) % 8;

                if (bitsNeeded == 0)
                    bitsNeeded = 2;
                else if (bitsNeeded == 2)
                    bitsNeeded = 4;
                else if (bitsNeeded == 4)
                    bitsNeeded = 6;
                else if (bitsNeeded == 6)
                {
                    bitsNeeded = 0;
                    previousValue = 0;
                }
            }
        }

        public void Finish()
        {
            try
            {
                if (morePaddingExpected)
                {
                    throw new Exception();
                }
                return;
            }
            finally
            {
            }
        }
        B64ToWindowedAverageToB64_BytesToInt32 next = new B64ToWindowedAverageToB64_BytesToInt32();
    }
