    class B64ToWindowedAverageToB64_Base64Encoder
    {
        byte previous;
        int indexInGroup = 0;

        byte EncodeIndex(int index)
        {
            if (0 <= index & index <= 25)
            {
                return (byte)('A' + index);
            }
            else if (26 <= index & index <= 51)
            {
                return (byte)('a' + (index - 26));
            }
            else if (52 <= index & index <= 61)
            {
                return (byte)('0' + (index - 52));
            }
            else if (index == 62)
            {
                return (byte)'+';
            }
            else
            {
                return (byte)'/';
            }
        }

        public void Update(byte c)
        {
            int index;
            if (indexInGroup == 0)
            {
                index = (c >> 2) & 0x3f;
            }
            else if (indexInGroup == 1)
            {
                index = ((previous & 0x3) << 4) | ((c >> 4) & 0xf);
            }
            else
            {
                index = ((previous & 0xf) << 2) | ((c >> 6) & 0x3);
            }

            //indexInGroup = (indexInGroup + 1) % 3;

            if (indexInGroup == 0)
                indexInGroup = 1;
            else if (indexInGroup == 1)
                indexInGroup = 2;
            else if (indexInGroup == 2)
                indexInGroup = 0;

            previous = c;

            next.Update(EncodeIndex(index));

            if (indexInGroup == 0)
            {
                index = c & 0x3f;
                next.Update(EncodeIndex(index));
                previous = 0;
            }
        }

        public void Finish()
        {
            try
            {
                int index;
                if (indexInGroup == 0)
                {
                    return;
                }
                else if (indexInGroup == 1)
                {
                    index = (previous & 0x3) << 4;
                }
                else
                {
                    index = ((previous & 0xf) << 2);
                }

                next.Update(EncodeIndex(index));

                // Add padding
                if (indexInGroup == 1)
                {
                    next.Update((byte)'=');
                    next.Update((byte)'=');
                }
                else
                {
                    next.Update((byte)'=');
                }
            }
            finally
            {
            }
        }
        UpdateStream next = StreamHolder.Stream;
    }


