    class B64FormattedDeltaUTF8_FormatInt32Lines
    {
        int NumDigits(long x)
        {
            int digits = 10;
            for (int i = 999999999; i > 0; i /= 10, --digits)
            {
                if (x > i)
                {
                    return digits;
                }
            }
            return digits;
        }

        int DigitAt(long x, int i)
        {
            int power10 = 1;
            for (int j = 0; j < i; ++j)
            {
                power10 *= 10;
                if (power10 == 1000000000)
                    break;
            }
            return (int)((x / power10) % 10);
        }

        public void Update(int c)
        {
            if (c == 0)
            {
                next.Update('0');
                return;
            }

            long sign = 1L;
            if (c < 0)
            {
                next.Update('-');
                sign = -1L;
            }


            int digits = NumDigits(sign * c);
            int divisor = 1;
            for (int i = 0; i < digits - 1; ++i)
            {
                divisor *= 10;
            }
            for (int i = 0; i < digits; ++i)
            {
                var digit = (c / divisor) % 10;
                next.Update((char)(sign * digit + '0'));
                divisor /= 10;
            }

            next.Update('\n');
        }
        public void Finish()
        {
            next.Finish();
        }
        B64FormattedDeltaUTF8_UTF16ToUTF8 next = new B64FormattedDeltaUTF8_UTF16ToUTF8();
    }
    class B64FormattedDeltaUTF8_UTF16ToUTF8
    {
        bool wasHigh = false;
        byte highBits;

        public void Update(char c)
        {
            if (wasHigh)
            {
                if ((0xDC00 <= c) & (c <= 0xDFFF))
                {//low surrogate
                    wasHigh = false;
                    highBits = 0;
                    next.Update((byte)((0x80 | (highBits << 4)) | ((c >> 6) & 0xF)));
                    next.Update((byte)(0x80 | (c & 0x3F)));
                }
                else
                {
                    throw new Exception();
                }
            }
            else
            {
                if ((0 <= c) & (c <= 0x7F))
                {
                    next.Update((byte)c);
                }
                else if ((0x7F < c) & (c <= 0x7FF))
                {
                    next.Update((byte)(0xC0 | ((c >> 6) & 0x1F)));
                    next.Update((byte)(0x80 | (c & 0x3F)));
                }
                else if ((0x7FF < c) & (c <= 0xFFFF) & ((c < 0xD800) | (c > 0xDFFF)))
                {
                    next.Update((byte)(0xE0 | ((c >> 12) & 0xF)));
                    next.Update((byte)(0x80 | ((c >> 6) & 0x3F)));
                    next.Update((byte)(0x80 | (c & 0x3F)));
                }
                else if ((0xD800 <= c) & (c <= 0xDBFF))
                {//high surrogate
                    wasHigh = true;
                    highBits = (byte)(c & 3);
                    next.Update((byte)(0xF0 | (((1 + ((c >> 6) & 0xF)) >> 2) & 7)));
                    next.Update((byte)((0x80 | (((1 + ((c >> 6) & 0xF)) & 3) << 4)) | ((c >> 2) & 0xF)));
                }
                else
                {
                    throw new Exception();
                }
            }
        }

        public void Finish()
        {
            try
            {
                if (wasHigh)
                {
                    throw new Exception();
                }
                return;
            }
            finally
            {
            }
        }
        UpdateStream next = StreamHolder.Stream;
    }


    //FormattedLineCount
    class FormattedLineCount_UTF8ToUTF16
    {
        int state;
        char r;

        char Fuse(char r, char c)
        {
            return (char)((r << 6) | (c & 0x3F));
        }

        public void Update(byte c)
        {
            if (state == 0)
            {
                if ((0 <= c) & (c <= 0x7F))
                {
                    next.Update((char)c);
                }
                else if ((0xC2 <= c) & (c <= 0xDF))
                {
                    state = 2;
                    r = (char)(c & 0x1F);
                }
                else if (c == 0xE0)
                {
                    state = 4;
                    r = (char)(c & 0x0F);
                }
                else if (c == 0xED)
                {
                    state = 5;
                    r = (char)(c & 0x0F);
                }
                else if ((0xE1 <= c) & (c <= 0xEF))
                {
                    state = 3;
                    r = (char)(c & 0x0F);
                }
                else
                {
                    throw new Exception();
                }
            }
            else if (state == 2)
            {
                if ((0x80 <= c) & (c <= 0xBF))
                {
                    next.Update(Fuse(r, (char)c));
                    state = 0;
                    r = (char)0;
                }
                else
                {
                    throw new Exception();
                }
            }
            else if (state == 3)
            {
                if ((0x80 <= c) & (c <= 0xBF))
                {
                    state = 2;
                    r = Fuse(r, (char)c);
                }
                else
                {
                    throw new Exception();
                }
            }
            else if (state == 4)
            {
                if ((0xA0 <= c) & (c <= 0xBF))
                {
                    state = 2;
                    r = Fuse(r, (char)c);
                }
                else
                {
                    throw new Exception();
                }
            }
            else if (state == 5)
            {
                if ((0x80 <= c) & (c <= 0x9F))
                {
                    state = 2;
                    r = Fuse(r, (char)c);
                }
                else
                {
                    throw new Exception();
                }
            }
        }
        public void Finish()
        {
            next.Finish();
        }
        FormattedLineCount_LineCount next = new FormattedLineCount_LineCount();
    }
