    class Maximum
    {
        int m = -1;

        int Max(int a, int b)
        {
            if (a > b)
            {
                return a;
            }
            else
            {
                return b;
            }
        }

        public void Update(int c)
        {
            //if (c >= m)
            //{
            //    m = c;
            //}
            m = Max(c, m);
            return;
        }

        public void Finish()
        {
            next.Update(m);
        }
        Int32ToBytes next = new Int32ToBytes();
    }
    class Int32ToBytes
    {
        UpdateStream next = StreamHolder.Stream;
        public void Update(int c)
        {
            next.Update((byte)(c >> 24));
            next.Update((byte)(c >> 16));
            next.Update((byte)(c >> 8));
            next.Update((byte)(c));
        }
    }
